import Vue from 'vue'
import App from './App.vue'
// import Vant from 'vant';

// Vue.use(Vant);

const MyComponent = Vue.extend({
    render(h) {
      // 'h'是createElement函数，用于创建虚拟节点
      // 'div'是标签名，'hello'是文本内容
      return h(App);
    }
})
new Vue({
   el: "#app",
   components: {MyComponent}
})
// createApp(App).mount('#app')
